window.bookSummaryJSON = "<p><b>In the third gripping installment of The Order Series, Forest Blackburn, burdened by her past and haunted by her demons, faces her toughest challenge yet.</b></p> <p>As the death of those closest to her shatters her world, Forest finds herself teetering on the edge of darkness, grappling with grief and betrayal.</p> <p>Caught in a web of deceit and danger, Forest discovers that the lies she once believed were harmless have morphed into deadly threats. In a world where trust is a rare commodity, she must confront the enemy within and face Xavier Evermoore, the man Forest despises above all others.</p> <p>Despite their animosity, Xavier holds the key to unlocking the mysteries surrounding her past and present. Reluctantly, Forest must turn to him for answers, knowing that their alliance may be her only hope for survival.</p> <p>As tensions escalate and the specter of war looms on the horizon, Forest is forced to confront her true nature. Within the depths of her soul lies a power that could tip the scales of the impending conflict. As she navigates the treacherous waters of her own identity, Forest discovers that the choices she makes will not only define her destiny but also reveal the true colors of her soul.</p>"; 
